-- ----------------------------
--  Table structure for `actproduct`
-- ----------------------------
DROP TABLE IF EXISTS `actproduct`;
CREATE TABLE `actproduct` (
  `ap_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '活品id',
  `ap_name` char(16) DEFAULT NULL COMMENT '活品名称',
  `ap_remarks` varchar(100) DEFAULT NULL COMMENT '备注',
  `ap_price` float(10,2) DEFAULT NULL COMMENT '价格',
  `ap_color` char(10) DEFAULT NULL,
  `ap_brand` char(16) DEFAULT NULL,
  `ap_st` char(20) DEFAULT NULL,
  `ap_defect` char(20) DEFAULT NULL,
  `ap_washingef` char(20) DEFAULT NULL,
  `bill_id` int(11) DEFAULT NULL COMMENT '销售单id',
  PRIMARY KEY (`ap_id`)
) ENGINE=InnoDB AUTO_INCREMENT=872 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `admin`
-- ----------------------------
DROP TABLE IF EXISTS `admin`;
CREATE TABLE `admin` (
  `a_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '管理员id',
  `a_name` char(15) NOT NULL COMMENT '管理员名称',
  `password` char(32) NOT NULL COMMENT '登录密码',
  `state` char(10) DEFAULT NULL COMMENT '状态',
  `shopname` varchar(20) DEFAULT NULL COMMENT '总店名称',
  `createtime` varchar(15) NOT NULL DEFAULT '' COMMENT '创建时间',
  `expirationtime` varchar(15) NOT NULL COMMENT '到期时间',
  PRIMARY KEY (`a_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `bill`
-- ----------------------------
DROP TABLE IF EXISTS `bill`;
CREATE TABLE `bill` (
  `bill_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '销售单id',
  `bill_name` varchar(255) NOT NULL COMMENT '销售单号（店名+时间戳）',
  `bill_createdate` char(25) DEFAULT NULL COMMENT '销售单日期',
  `bill_closingdate` char(25) DEFAULT NULL COMMENT '结账日期',
  `bill_paid` float(10,2) DEFAULT '0.00' COMMENT '实收金额',
  `bill_remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `bill_state` char(35) DEFAULT '未取衣' COMMENT '销售单状态',
  `u_id` int(11) NOT NULL COMMENT '会员id',
  `a_id` int(11) DEFAULT NULL COMMENT '管理员id',
  PRIMARY KEY (`bill_id`),
  KEY `u_id` (`u_id`)
) ENGINE=InnoDB AUTO_INCREMENT=645 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `cardtype`
-- ----------------------------
DROP TABLE IF EXISTS `cardtype`;
CREATE TABLE `cardtype` (
  `cardtype_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员卡id',
  `cardtype_name` char(20) DEFAULT NULL COMMENT '会员卡名称',
  `cardtype_discount` float(3,2) NOT NULL DEFAULT '1.00' COMMENT '会员卡折扣',
  `a_id` int(11) DEFAULT NULL COMMENT '管理员id',
  PRIMARY KEY (`cardtype_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `clothes`
-- ----------------------------
DROP TABLE IF EXISTS `clothes`;
CREATE TABLE `clothes` (
  `clothes_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '衣物id',
  `clothes_name` char(10) DEFAULT NULL COMMENT '衣物名称',
  `clothes_price` float DEFAULT NULL COMMENT '湿洗价格',
  `clothes_dryprice` float DEFAULT NULL COMMENT '干洗价格',
  `a_id` int(11) DEFAULT NULL COMMENT '管理员id',
  PRIMARY KEY (`clothes_id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `shop`
-- ----------------------------
DROP TABLE IF EXISTS `shop`;
CREATE TABLE `shop` (
  `shop_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '分店id',
  `shop_name` varchar(255) DEFAULT NULL COMMENT '分店名称',
  `a_id` int(11) DEFAULT NULL COMMENT '管理员id',
  PRIMARY KEY (`shop_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `u_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员id',
  `u_name` varchar(255) NOT NULL COMMENT '姓名',
  `u_phone` varchar(11) DEFAULT NULL COMMENT '联系电话',
  `u_sex` char(1) DEFAULT NULL COMMENT '性别',
  `u_card` char(15) DEFAULT NULL COMMENT '会员卡号',
  `u_birth` char(15) DEFAULT NULL COMMENT '出生日期',
  `u_balance` float(10,2) DEFAULT '0.00' COMMENT '余额',
  `u_signdate` char(15) DEFAULT NULL,
  `u_remarks` varchar(200) DEFAULT NULL,
  `cardtype_id` int(11) DEFAULT NULL COMMENT '会员卡类型id',
  `a_id` int(11) DEFAULT NULL COMMENT '所属管理员id',
  PRIMARY KEY (`u_id`)
) ENGINE=InnoDB AUTO_INCREMENT=253 DEFAULT CHARSET=utf8;

